import React from "react";

const RaceVotes = ({ race, votes }) => {
  const hashMap = Map();
  hashMap.set(race.personOneName, 0);
  hashMap.set(race.personTwoName, 0);
  hashMap.set(race.personThreeName, 0);

  votes.ForEach((vote) => {
    if (vote.raceID === race.raceID) {
      hashMap.set(vote.VotePerson, hashMap.get(vote.VotePerson) + 1);
    }
  });

  return (
    <div>
      <h1>Race Votes</h1>
      <p>
        {race.personOneName} : {hashMap.get(race.personOneName)}
      </p>
      <p>
        {race.personTwoName} : {hashMap.get(race.personTwoName)}
      </p>
      <p>
        {race.personThreeName} : {hashMap.get(race.personThreeName)}
      </p>
    </div>
  );
};

export default RaceVotes;
